  false,\n\t\"url\": null,\n\t\"notes\": \"The Refuge will cooperate with and support
  CDFG in their ongoing monitoring of CWD within California. The Service adopts the
  2005 CWO Response Plan and Communication Guide (see Appendix A) produced by the
  CDFG. The goals included within the CDFG Response Plan do not conflict with Refuge
  policies and management.  Planning Goals on Modoc NWR:  1. Provide for early detection
  of CWO incursion into the Refuge.  2. Coordinate with, and assist the CDFG in combating
  CWO.  3. Minimize CWO impact on Refuge mule deer.\",\n\t\"license_title\": \"License
